import React from 'react';
import './styles/style.css';
import App from './App';
import Navbar from './components/Navbar';
import ReactDOM from "react-dom/client";


const Root = () => (
  <Router>
    <Navbar />
    <Routes>
      <Route path="/" element={<App />} />
      {/* Define other routes here */}
    </Routes>
  </Router>
);

export default Root;
